import React from "react";
import resume from "../components/assets/Daphne_Wu_Resume1.pdf";

const Resume = () => (
    <div className="h-screen overflow-hidden">
      {/* Embed the PDF cleanly with no extra controls */}
      <embed 
        src={resume}  // Path to your PDF file in the public folder
        width="100%" 
        height="100%" 
        type="application/pdf"
        style={{ border: "none", display: "block" }} // Clean, no border, no scrollbar
      />
    </div>
  );

export default Resume;
